import React from 'react';
import { Routes, Route } from "react-router-dom";
// import Slider from "react-slick";
// import $ from "jquery";
import './App.css';

function Main() {
  return (
    <React.Fragment>

    </React.Fragment>
  )
}

function App() {

  return (
    <React.Fragment>
      <Routes>
        <Route path="/" element={<Main />}></Route>
        <Route path="/*" element={<Main />}></Route>
      </Routes>
    </React.Fragment>
  );
}

export default App;
